import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faChevronDown } from '@fortawesome/free-solid-svg-icons';

export const downArrow = <FontAwesomeIcon icon={faChevronDown} style={{width:"30px", height:"30px", color:"#ffff"}}/>
export const facebook= <FontAwesomeIcon icon={faFacebook} style={{width:"30px", height:"30px", color:"#ffff"}}/>
export const instagram= <FontAwesomeIcon icon={faInstagram} style={{width:"30px", height:"30px", color:"#ffff"}}/>
export const linkedin= <FontAwesomeIcon icon={faLinkedin} style={{width:"30px", height:"30px", color:"#ffff"}}/>
